text:
후반부가 전반부보다 재밌다는 사람들 의견
나머지는 굳이굳이 그나마 다 이해해도 저 빌런 배우분이 너무 어리셔서 연기력이 아무래도 모자를 수밖에 없는데
매인 빌런이니까 저분 나올때마다 번개문방구같아서 짜게 식음;;

1. 무슨 사상이나 이런 거 없이도 그냥 행사 취지가 유방암 인식 향상에 안 맞음
2. 그래서 자선 사업으로 연예인 불러서 놀고 싶어 보임
3. 연예인들이 간판이니까 연예인만 욕먹지만 사실 그냥 주최 측이 취지를 망각한 거임;
4. 다들 즐기는 와중에 소신발언 같은 걸... 하면 의로운 거고 아니면 마는 거임... 쉽지 않음;

술쳐마시는게 노이해;
비공개로 즈그들끼리 어디가서 모여마시던가
뭐 환자들 조롱하는것도아니고

박재범이 변명으로 무페이라고 어필한게 젤 웃김
무페이면 뭐? ㅋㅋ 누굴 위한 무페이인데;
대중 그 누구도 직접 못봤고 즐기지않았고 불쾌했으며 저기 간 연예인들만 놀다온건데 알바노

야~ 조세호는 여기도 껴있나?;;
아 진짜 질떨어지네;;;
박은빈 개념있다~~!!!!

처음부터 셀럽 파티한다고 했으면 그런갑다 하겠는데 유방암 인식 향상 캠페인 자선행사 한다고 해놓고 저러면 기괴한거지 조롱하는것도 아니고 진짜

연예인들 쉴드 치는 애들 나오는 것도 웃긴게 관련해서 유방암에 대해 아무 말도 안하고 술 마시고 춤 추다가 간 사람들이 뭔 잘못이 없어 
뭐 애냐? 애도 그정도 사리분별은 하겠다;;

기부나 좋은 일은 의무는 아니니까 기부 적게 했다 뭐 이런 걸로 얘기하는 건 좀 그렇고
차라리 저런 행사를 하질 말든가;
그냥 아예 생각을 안 하고 사나 봐 스스로
